import React, { useState } from "react";

const Navbar = () => {
  const [name, setName] = useState("");
  const [phone, setPhone] = useState("");
  const [email, setEmail] = useState("");
  const [place, setPlace] = useState("");
  const [district, setDistrict] = useState("");
  const [otp, setOtp] = useState("");
  const [otpSent, setOtpSent] = useState(false);

  const handleSignup = async () => {
    try {
      const res = await fetch("/api/signup", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ name, phone, email, place, district })
      });

      const data = await res.json();
      alert(data.message);

      if (data.success) {
        setName("");
        setPhone("");
        setEmail("");
        setPlace("");
        setDistrict("");
      }
    } catch (err) {
      alert("Signup failed");
      console.error(err);
    }
  };

  const handleSendOtp = async () => {
    if (!phone) return alert("Enter phone number first!");

    try {
      const res = await fetch("/api/signin", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ phone })
      });

      const data = await res.json();

      if (data.success) {
        alert("OTP sent! (Check server logs in dev)");
        setOtpSent(true);
      } else {
        alert(data.message);
      }
    } catch (err) {
      console.error(err);
      alert("Failed to send OTP");
    }
  };

  const handleVerifyOtp = async () => {
    try {
      const res = await fetch("/api/verify-otp", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ phone, otp })
      });

      const data = await res.json();

      if (data.success) {
        alert("Signin successful!");
        setOtp("");
        setPhone("");
        setOtpSent(false);
      } else {
        alert(data.message);
      }
    } catch (err) {
      console.error(err);
      alert("Failed to verify OTP");
    }
  };

  return (
    <nav className="navbar">
      <h2>CrackerMart</h2>

      <div className="auth-box">
        <h3>Sign Up</h3>
        <input value={name} onChange={(e) => setName(e.target.value)} placeholder="Name" />
        <input value={phone} onChange={(e) => setPhone(e.target.value)} placeholder="Phone" />
        <input value={email} onChange={(e) => setEmail(e.target.value)} placeholder="Email" />
        <input value={place} onChange={(e) => setPlace(e.target.value)} placeholder="Place" />
        <input value={district} onChange={(e) => setDistrict(e.target.value)} placeholder="District" />
        <button onClick={handleSignup}>Sign Up</button>
      </div>

      <div className="auth-box">
        <h3>Sign In</h3>
        {!otpSent ? (
          <>
            <input value={phone} onChange={(e) => setPhone(e.target.value)} placeholder="Phone" />
            <button onClick={handleSendOtp}>Send OTP</button>
          </>
        ) : (
          <>
            <input value={otp} onChange={(e) => setOtp(e.target.value)} placeholder="Enter OTP" />
            <div style={{ display: "flex", gap: "8px" }}>
              <button onClick={handleVerifyOtp}>Verify OTP</button>
              <button
                onClick={() => {
                  setOtpSent(false);
                  setOtp("");
                }}
              >
                Change Number
              </button>
            </div>
          </>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
